  };

  // 处理添加评论
  const handleAddComment = () => {
    if (!newComment.trim()) {
      message.warning('请输入评论内容');
      return;
    }

    const comment: InternalComment = {
      id: Date.now().toString(),
      content: newComment,
      author: 'CSM-小王',
      createdAt: new Date().toLocaleString('zh-CN'),
    };

    setInternalComments([comment, ...internalComments]);
    setNewComment('');
    message.success('评论已添加');
  };

  // 处理干系人更新
  const handleStakeholderUpdate = (updatedStakeholder: Stakeholder) => {
    setStakeholders(prev => 
      prev.map(s => s.id === updatedStakeholder.id ? updatedStakeholder : s)
    );
  };

  // 处理干系人添加
  const handleStakeholderAdd = (newStakeholder: Stakeholder) => {
    setStakeholders(prev => [...prev, newStakeholder]);
  };

  // 处理干系人删除
  const handleStakeholderDelete = (id: string) => {
    setStakeholders(prev => prev.filter(s => s.id !== id));
  };

  if (loading) {
    return (
      <div style={{ 
        padding: '24px', 
        textAlign: 'center',
        background: '#f5f5f5',
        minHeight: 'calc(100vh - 120px)',
        paddingBottom: '60px' // 为footer留出底部间距
      }}>
        <div>加载中...</div>
      </div>
    );
  }

  if (!handoverData) {
    return (
      <div style={{ 
        padding: '24px', 
        textAlign: 'center',
        background: '#f5f5f5',
        minHeight: 'calc(100vh - 120px)',
        paddingBottom: '60px' // 为footer留出底部间距
      }}>
        <div>未找到客户交接记录</div>
      </div>
    );
  }

  // 状态标签颜色映射
  const statusColorMap = {
    normal: 'green',
    not_handover: 'orange',
    risk: 'red'
  };

  const statusTextMap = {
