  { key: 'a6', name: '客户F', owner: '张伟', health: '一般', healthScore: 76, lastInteractionDays: 29, lifecycle: '成熟期', renewalRisk: false, onboardingCompleted: true, profileCompleteness: 100, handoverCompleted: true },
